import React, { useEffect } from "react";
import "./App.css";
import MovieList from "./MovieList";
import { useState } from "react";
import Search from "./Search";
import Rating from "./Rating";
import bip from "./1417.wav";

function App() {
  const [search, setSearch] = useState("");
  const [rateApp, setRateApp] = useState(1);
  const [list, setList] = useState([
    {
      title: "Titanic",
      image:
        "https://media.senscritique.com/media/000004715818/source_big/Titanic.jpg",
      year: 1990,
      rating: 3,
    },
    {
      title: "Harry-potter",
      image:
        "https://fr.web.img2.acsta.net/pictures/18/07/02/17/25/3643090.jpg",
      year: 2000,
      rating: 5,
    },
    {
      title: "The Joker",
      image:
        "data:image/jpeg;base64,",
      year: 2019,
      rating: 5,
    },
    {
      title: "Dora",
      image:
        "data:image/jpeg;base64,",
      year: 2019,
      rating: 2,
    },
    {
      title: "The maze runner",
      image:
        "https://upload.wikimedia.org/wikipedia/en/thumb/b/be/The_Maze_Runner_poster.jpg/220px-The_Maze_Runner_poster.jpg",
      year: 2014,
      rating: 4,
    },
    {
      title: "Jmanji",
      image:
        "https://i.pinimg.com/474x/e5/d7/9d/e5d79d7950d6cbad313d9b41d48838c0.jpg",
      year: 2014,
      rating: 3,
    },
    {
      title: "Maleficent",
      image:
        "https://i.pinimg.com/originals/4e/ae/b1/4eaeb1733fc95c1c0e6a1d98d5bdebf5.jpg",
      year: 2014,
      rating: 3,
    },
    {
      title: "Don't breath",
      image: "https://fr.web.img3.acsta.net/pictures/16/03/17/10/50/331628.jpg",
      year: 2016,
      rating: 4,
    },
  ]);
  const bipping = new Audio(bip);
  useEffect(() => {
    document.title = "New Movie Added!";
    bipping.play();
    setTimeout(() => {
      document.title = "React App";
    }, 3000);
  }, [list]);
  useEffect(() => {
    bipping.pause();
    document.title = "React App";
  }, []);
  const addMovie = (add) => {
    setList([...list, add]);
  };
  const handleInput = (e) => {
    setSearch(e.target.value.toUpperCase().trim());
  };
  const handleRating = (rate) => {
    setRateApp(rate);
  };
  return (
    <div className="App">
      <div className="top">
          <div className="topDetail">
             <h1 className="enjoy">Movies</h1>
          </div>
          <div className="topDetail">
            <Search handleInput={(a) => handleInput(a)} />
          </div>
        <div className="topDetail">
          <h3 className="filter">Filter with Rating </h3>
          <Rating
            className="rating"
            rateApp={rateApp}
            handleRating={(a) => handleRating(a)}
          />
        </div>
      </div>
      <div className="movies">
        <MovieList
          Movies={list.filter(
            (el) =>
              el.title.toUpperCase().includes(search) && el.rating >= rateApp
          )}
          addMovie={(a) => addMovie(a)}
        />
      </div>
    </div>
  );
}

export default App;
